void do_yyparse(PyObject *parser_context, PyObject *tokens, int debug )
{
  yydebug = debug;
  yyparse( parser_context, tokens );
}

int yyerror(PyObject *parser_context, PyObject *tokens, char *mesg)
{
  parser_error( parser_context, tokens, mesg);
  return 0;
}


void set_yylval( PyObject *val ){
  yylval = val;
}

int yylogging(FILE *stream, const char *format, ...)
{
  char res[2048];
  va_list ap;
  va_start(ap, format);
  vsprintf(res, format, ap);
  va_end(ap);
  parser_logging_callback(res);
  return 0;
}
